class Solution:
    
    def __init__(self):
        self.ans = []
                
    def safe(self, x, y):
        k = x + y
        l = x - y
        for i in range(self.n):
            j1 = i - (x - y)
            j2 = (x + y) - i
            if self.mat[x][i] or self.mat[i][y]:
                return False
            if 0 <= j1 < self.n and self.mat[i][j1]:
                return False
            if 0 <= j2 < self.n and self.mat[i][j2]:
                return False
        return True    
    
    def convert(self):
        ans = []
        for i in range(self.n):
            s = ""
            for j in range(self.n):
                s += ("Q" if self.mat[i][j] else ".")
            ans.append(s)
        return ans
                    
    def solve(self, x, y, qc):
        if qc == self.n:
            #print(self.mat)
            # convert mat
            ans = self.convert()
            if ans not in self.ans:
                self.ans.append(ans.copy())
            return True
        
        for i in range(self.n):
            for j in range(self.n):
                    if not self.vis[i][j] and self.safe(i, j):
                        # Place the queen
                        self.mat[i][j] = True
                        self.vis[i][j] = True
                        # Recurse for the next queen
                        if not self.solve(i, j, qc + 1):
                            return False
                        # Remove the queen
                        self.vis[i][j] = False
                        self.mat[i][j] = False
        return True
    
    
    def solveNQueens(self, n: int) -> List[List[str]]:
        # Rec back solution
        if n < 7:
            self.n = n
            self.mat = [[False for i in range(n)] for j in range(n)]
            self.vis = [[False for i in range(n)] for j in range(n)]
